 if ((Inputs.chk_nohub.Value == false) && (Inputs.dec_buttonqty.Value == 0) && (Inputs.dec_hubqty.Value == 0))
 {
			MessageBox.Show("Currently no Hub Quantity has been calculated or manually entered. If a hub is not required please check the No Hub Req check box or enter a value manually.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
			PageLeaveFunctions.SetNextInputPage(1);
			Args.Cancel = true;

 }

 /* Check that the qty entered conforms with the parts UOM */
 bool DataTypeError = false;
 DataTypeError = false;


int partqty1 = System.Convert.ToInt32(Inputs.var_apartqty1.Value);
int partqty2 = System.Convert.ToInt32(Inputs.var_apartqty2.Value);
int partqty3 = System.Convert.ToInt32(Inputs.var_apartqty3.Value);
int partqty4 = System.Convert.ToInt32(Inputs.var_apartqty4.Value);
int partqty5 = System.Convert.ToInt32(Inputs.var_apartqty5.Value);


 if ((Inputs.var_apartqty1.Value - partqty1 != 0) && (Inputs.var_uom1.Value == "EA")) { DataTypeError = true; }
 if ((Inputs.var_apartqty2.Value - partqty2 != 0) && (Inputs.var_uom2.Value == "EA")) { DataTypeError = true; }
 if ((Inputs.var_apartqty3.Value - partqty3 != 0) && (Inputs.var_uom3.Value == "EA")) { DataTypeError = true; }
 if ((Inputs.var_apartqty4.Value - partqty4 != 0) && (Inputs.var_uom4.Value == "EA")) { DataTypeError = true; }
 if ((Inputs.var_apartqty5.Value - partqty5 != 0) && (Inputs.var_uom5.Value == "EA")) { DataTypeError = true; }

 if (DataTypeError == true)
 {

     if (((Context.CompanyID == "TENLT") || ( Context.CompanyID == "TENSAFZ") || ( Context.CompanyID == "TENUSA")) && (Inputs.chk_erroron.Value == true)) {
         MessageBox.Show("A Quantity entered is of the wrong data type. A UOM for weight or length can be entered as a decimal value but a line with a UOM of EA (Each) must be entered as an Integer. Please correct this error before proceeding.");
         PageLeaveFunctions.SetNextInputPage(4);
     }
 }

 /* Bom Part Verification */

 bool PartVerError = false;
 PartVerError = false;

 if (Inputs.chk_partverification.Value == true)
 {
     if ((Inputs.var_apart1.Value != "") && (Inputs.var_adesc1.Value == "")) { PartVerError = true; }
     if ((Inputs.var_apart2.Value != "") && (Inputs.var_adesc2.Value == "")) { PartVerError = true; }
     if ((Inputs.var_apart3.Value != "") && (Inputs.var_adesc3.Value == "")) { PartVerError = true; }
     if ((Inputs.var_apart4.Value != "") && (Inputs.var_adesc4.Value == "")) { PartVerError = true; }
     if ((Inputs.var_apart5.Value != "") && (Inputs.var_adesc5.Value == "")) { PartVerError = true; }

     MessageBox.Show("A Component entered in the BOM does not exist in the Parts Master table or has been made inactive. Please contact the Operations department or alternatively enter a different part");

     PageLeaveFunctions.SetNextInputPage(4);

 }

  /* Verify that a Quantity has been entered where required */

  bool qtycheckerror = false;
  qtycheckerror = false;

  if ((Inputs.var_apart1.Value != "") && (Inputs.var_apartqty1.Value == 0)) { qtycheckerror = true; }
  if ((Inputs.var_apart2.Value != "") && (Inputs.var_apartqty2.Value == 0)) { qtycheckerror = true; }
  if ((Inputs.var_apart3.Value != "") && (Inputs.var_apartqty3.Value == 0)) { qtycheckerror = true; }
  if ((Inputs.var_apart4.Value != "") && (Inputs.var_apartqty4.Value == 0)) { qtycheckerror = true; }
  if ((Inputs.var_apart5.Value != "") && (Inputs.var_apartqty5.Value == 0)) { qtycheckerror = true; }

  if (qtycheckerror == true)
  {

      if ((Context.CompanyID == "TENLTD") || (Context.CompanyID == "TENSAFZE") || (Context.CompanyID == "TENUSA"))
      {
          MessageBox.Show("Please enter a BOM Quantity for all lines where a Part has been entered.");
          PageLeaveFunctions.SetNextInputPage(4);
      }
  }

  /* Calculates Net Weight for BOM 2 */

  decimal aCompWeight1 = 0m;
  decimal aCompWeight2 = 0m;
  decimal aCompWeight3 = 0m;
  decimal aCompWeight4 = 0m;
  decimal aCompWeight5 = 0m;
  decimal partWeight = 0m;

  bool available_part = false;

  /* aCompWeight1 */
  if (Inputs.var_apart1.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_apart1.Value);
  }
  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_apart1.Value, out partWeight);
      aCompWeight1 = partWeight * Inputs.var_apartqty1.Value;
  }

  /* aCompWeight2 */
  if (Inputs.var_apart2.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_apart2.Value);
  }
  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_apart2.Value, out partWeight);
      aCompWeight2 = partWeight * Inputs.var_apartqty2.Value;
  }

  /* aCompWeight3 */
  if (Inputs.var_apart3.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_apart3.Value);
  }
  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_apart3.Value, out partWeight);
      aCompWeight3 = partWeight * Inputs.var_apartqty3.Value;
  }

  /* aCompWeight4 */
  if (Inputs.var_apart4.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_apart4.Value);
  }
  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_apart4.Value, out partWeight);
      aCompWeight4 = partWeight * Inputs.var_apartqty4.Value;
  }

   /* aCompWeight5 */
   if (Inputs.var_apart5.Value != "")
   {
       available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_apart5.Value);
   }
   if (available_part)
   {
       UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_apart5.Value, out partWeight);
       aCompWeight5 = partWeight * Inputs.var_apartqty5.Value;
   }


   /* Totals the individual component weights */
   Inputs.var_bomweight2.Value = aCompWeight1 + aCompWeight2 + aCompWeight3 + aCompWeight4 + aCompWeight5;

   /* Set the combined BOM NetWeight for display Page5 */
   Inputs.var_netweight.Value = Inputs.var_bomweight1.Value + Inputs.var_bomweight2.Value;

   /* All OK Move to Last Page */
   if ((PartVerError == false) && (DataTypeError == false) && (qtycheckerror == false))
   {
       PageLeaveFunctions.SetNextInputPage(5);
   }
